import React from "react";
import { Link } from "react-router-dom";

function PetsitterHeader() {
    return (
        <header className="petsitterHeader">
            <div className="headerElem">
                <Link to='/'>
                    <button>Главная</button>
                </Link>
            </div>
        </header>
    );
}

export default PetsitterHeader;
